import React from 'react';
import { motion } from 'framer-motion';
import { Lightbulb, TrendingUp, Target, Calendar, AlertCircle } from 'lucide-react';

const SmartSuggestions = ({ notes = [], tasks = [], folders = [] }) => {
  const generateSuggestions = () => {
    const suggestions = [];

    // Check for inactive archives
    const recentNotes = notes.filter(note => {
      const noteDate = new Date(note.createdAt || note.updatedAt);
      const threeDaysAgo = new Date();
      threeDaysAgo.setDate(threeDaysAgo.getDate() - 3);
      return noteDate >= threeDaysAgo;
    });

    const activeArchives = new Set(recentNotes.map(note => note.folderId).filter(Boolean));
    const inactiveArchives = folders.filter(folder => !activeArchives.has(folder.id));

    if (inactiveArchives.length > 0) {
      suggestions.push({
        id: 'inactive-archive',
        type: 'reminder',
        icon: AlertCircle,
        title: 'Inactive Archive Detected',
        message: `You haven't written in "${inactiveArchives[0].name}" for 3+ days`,
        action: 'Create a new log',
        color: 'text-yellow-400',
        bgColor: 'border-yellow-400'
      });
    }

    // Check for productivity patterns
    const todayOfWeek = new Date().getDay();
    const weekdayNames = ['Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday'];

    suggestions.push({
      id: 'productivity-tip',
      type: 'insight',
      icon: TrendingUp,
      title: 'Productivity Pattern',
      message: `${weekdayNames[todayOfWeek]}s are great for focused work - consider tackling important tasks today!`,
      action: 'View task list',
      color: 'text-cyan-400',
      bgColor: 'border-cyan-400'
    });

    // Check incomplete tasks
    const incompleteTasks = tasks.filter(task => !task.completed);
    if (incompleteTasks.length > 5) {
      suggestions.push({
        id: 'task-overload',
        type: 'warning',
        icon: Target,
        title: 'Task Overload Alert',
        message: `You have ${incompleteTasks.length} pending tasks - consider prioritizing the most important ones`,
        action: 'Review tasks',
        color: 'text-orange-400',
        bgColor: 'border-orange-400'
      });
    }

    // Check for achievement progress
    const notesWithTags = notes.filter(note => {
      const tags = note.tagsString || note.tags || '';
      return tags.trim().length > 0;
    }).length;

    if (notesWithTags >= 8 && notesWithTags < 10) {
      suggestions.push({
        id: 'achievement-close',
        type: 'achievement',
        icon: Target,
        title: 'Achievement Almost Unlocked!',
        message: `Add tags to ${10 - notesWithTags} more notes to unlock the "Organizer" achievement`,
        action: 'Add tags',
        color: 'text-purple-400',
        bgColor: 'border-purple-400'
      });
    }

    return suggestions.slice(0, 3); // Show max 3 suggestions
  };

  const suggestions = generateSuggestions();

  if (suggestions.length === 0) {
    return (
      <div className="bg-gray-800 border-2 border-green-400 shadow-[4px_4px_0px_0px_rgba(0,0,0,1)] p-6 relative"
           style={{
             boxShadow: '0 0 15px rgba(34, 197, 94, 0.2), 4px 4px 0px 0px rgba(0,0,0,1)'
           }}>
        <div className="absolute inset-0 border-2 border-green-400 opacity-30 animate-pulse pointer-events-none" />

        <h2 className="text-lg font-mono font-bold text-white flex items-center mb-4">
          <div className="w-4 h-4 bg-green-400 mr-2" />
          SMART SUGGESTIONS
        </h2>

        <div className="text-center py-4">
          <Lightbulb size={32} className="text-green-400 mx-auto mb-2" />
          <div className="text-sm font-mono text-green-400">All systems optimal!</div>
          <div className="text-xs font-mono text-gray-400 mt-1">No suggestions at this time</div>
        </div>
      </div>
    );
  }

  return (
    <div className="bg-gray-800 border-2 border-blue-400 shadow-[4px_4px_0px_0px_rgba(0,0,0,1)] p-6 relative"
         style={{
           boxShadow: '0 0 15px rgba(59, 130, 246, 0.2), 4px 4px 0px 0px rgba(0,0,0,1)'
         }}>
      <div className="absolute inset-0 border-2 border-blue-400 opacity-30 animate-pulse pointer-events-none" />

      <h2 className="text-lg font-mono font-bold text-white flex items-center mb-4">
        <div className="w-4 h-4 bg-blue-400 mr-2" />
        SMART SUGGESTIONS
      </h2>

      <div className="space-y-3">
        {suggestions.map((suggestion, index) => {
          const Icon = suggestion.icon;
          return (
            <motion.div
              key={suggestion.id}
              initial={{ opacity: 0, x: -20 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ delay: index * 0.1 }}
              className={`bg-gray-900 border ${suggestion.bgColor} p-3 relative`}
              style={{ boxShadow: '0 0 5px rgba(59, 130, 246, 0.2), 1px 1px 0px 0px rgba(0,0,0,1)' }}
            >
              <div className="flex items-start gap-3">
                <Icon size={16} className={`${suggestion.color} mt-0.5 flex-shrink-0`} />
                <div className="flex-1 min-w-0">
                  <div className={`font-mono font-bold text-sm ${suggestion.color} mb-1`}>
                    {suggestion.title}
                  </div>
                  <div className="text-xs font-mono text-gray-300 leading-relaxed">
                    {suggestion.message}
                  </div>
                  <div className={`text-xs font-mono ${suggestion.color} mt-2 opacity-80`}>
                    💡 {suggestion.action}
                  </div>
                </div>
              </div>
            </motion.div>
          );
        })}
      </div>
    </div>
  );
};

export default SmartSuggestions;
